import React from 'react';

import Card from '../Card/Card';
import classes from './Feira.module.css';

const feira = ( props ) => {
    return (
        <Card 
            nome={props.nome} 
            descr={props.descr}
            footer={props.data}
            img={props.data}
        />
    );
};

export default feira;
